import React, { Component } from 'react';
import File from './File';
class App extends Component {
	constructor() {
		super();
		this.state = {
      number: 0,
    };
	}
	render() {
		return (
			<div>
				<File name="File1" content="file" />
			</div>
		);
	}
}

export default App;
